%[text] # Using functions provided by a Python package in electrophysiology analysis
%[text] *Elephant* (Electrophysiology Analysis Toolkit) is an emerging open-source, community centered library for the analysis of electrophysiological data in the Python programming language.
%[text] The focus of Elephant is on generic analysis functions for spike train data and time series recordings from electrodes, such as the local field potentials (LFP) or intracellular voltages. In addition to providing a common platform for analysis codes from different laboratories, the Elephant project aims to provide a consistent and homogeneous analysis framework that is built on a modular foundation.
%[text] ![](text:image:1f43)
%[text] Elephant ([doi:10.5281/zenodo.1186602](https://doi.org/10.5281/zenodo.1186602); [RRID:SCR\_003833](https://scicrunch.org/resolver/RRID:SCR_003833))
%[text] In this example we will explore how to import python code in MATLAB and perform additional analysis. 
%%
%[text] %[text:anchor:H_70da] ## Check your environment    
%[text] First let's confirm that MATLAB recognizes the Python interpreter on your machine:
pyenv %[output:3c36e647]
%[text] Depending on our configuration, you can use arguments to this function to point to a specific interpreter in case you have access to more than one:
%% pyenv(Version="C:\\path\to\specific\python.exe") 
%[text] Or to set the run mode to "OutOfProcess" which allows Python to be run in a separate process (for example, to prevent MATLAB from crashing if the Python code fails):
%% pyenv(ExecutionMode = "OutOfProcess")
%%
%[text] Now that you know that MATLAB can identify your specific Python interpreter, make sure all the Python packages needed for your project are properly installed in your system. In this case, we need the package elephant and other dependencies, so let's get them installed running the setup script: 
setup
%%
%[text] %[text:anchor:H_6C9B51AD] ## Basic syntax when using Python code in MATLAB
%[text] All Python functions in MATLAB have the same basic syntax:
%[text] ![](text:image:8a13)
%[text] Now let's use the py syntax to call functions (py . package . function(args)); no need to use "import":
py.math.sqrt(42)
