%[text] %[text:anchor:H_41d9] ## **Use Python code in MATLAB**
%[text] In this MATLAB notebook, you can add tasks, which are simple point-and-click interfaces that can be added to a live script to perform a specific set of operations. Tasks represent a series of MATLABÂ® commands. You can display their output either inline or on the right. To see the MATLAB commands that the task runs, show the generated code.  Using the Live Task to include Python code we can make the process of using this file easier.  You can find the "**Run Python Code**" Live Task in the LIVE EDITOR tab, in the "Task" menu:
%[text] ![](text:image:4863)
%[text] The Run Python Code task lets you interactively run Python code or files. The task automatically generates MATLAB code for your live script. Using this task you can: 
%[text] - Execute code in Python files.
%[text] - Return Python variables to the MATLAB workspace.
%[text] - Pass MATLAB data to the Python code. \
%[text] Once you have the task in your notebook, you have the option to use a File or add your Python code directly. 
%[text] ![](text:image:375e)
%[text] 
%[text] ### Example 1: Adding python code
% Python code input %[task:8821]
pycode = [...
"import numpy as np",...
"from quantities import ms, s, Hz",...
"from elephant.spike_train_generation import homogeneous_poisson_process, homogeneous_gamma_process",...
"",...
"",...
"t_start = 275.5 * ms",...
"print(t_start)",...
"",...
"t_start2 = 3. * s",...
"t_start_sum = t_start + t_start2",...
"print(t_start_sum)",...
"",...
"np.random.seed(28)  # to make the results reproducible",...
"spiketrain1 = homogeneous_poisson_process(rate=10*Hz, t_start=0.*ms, t_stop=10000.*ms)",...
"spiketrain2 = homogeneous_gamma_process(a=3, b=10*Hz, t_start=0.*ms, t_stop=10000.*ms)"...
];

try
    [spiketrain1, spiketrain2] = pyrun(pycode, ...
         [ "spiketrain1" "spiketrain2" ])
catch ME
    % Clear temporary variables from workspace and from Python
    clear pycode;
    rethrow(ME)
end

% Clear temporary variables from workspace and from Python
clear pycode; %[task:8821]
%[text] 
%%
%[text] The code above does basic statistics operations. We start by importing physical quantities (seconds, milliseconds and Hertz) and two generators of spiketrains - `homogeneous_poisson_process()` and `homogeneous_gamma_process()` functions from `elephant.spike_train_generation` module.
%[text] The function requires four parameters: the firing rate of the Poisson process, the start time and the stop time, and the refractory period (default `refractory_period=None` means no refractoriness). The first three parameters are specified as Quantity objects: these are essentially arrays or numbers with a unit of measurement attached. We specify `t_start` to be equal to 275.5 milliseconds
%[text] For spiketrains generation, in the python code provided we used one Poisson and one Gamma processes:
%[text] `spiketrain1 = homogeneous_poisson_process(rate=10*Hz, t_start=0.*ms, t_stop=10000.*ms)`
%[text] `spiketrain2 = homogeneous_gamma_process(a=3, b=10*Hz, t_start=0.*ms, t_stop=10000.*ms)`
%[text] The important properties of a `SpikeTrain` are:
%[text] - `times` stores the spike times in a numpy array with the specified units;
%[text] - `t_start` - the beginning of the recording/generation;
%[text] - `t_stop` - the end of the recording/generation.
%[text] - `magnitude` \
%[text] We can then use the output to extract information and convert it into something that MATLAB can use:
value1 = spiketrain1.magnitude
V1 = double(value1)

value2 = spiketrain2.magnitude
V2 = double(value2)
%%
%[text] Let's now use the output to create a basic raster plot:
num_spikes = length(V1)
plot([V1; V1], [ones(1, num_spikes); ones(1, num_spikes)+1],'k')

num_spikes2 = length(V2)
plot([V2; V2], [ones(1, num_spikes2); ones(1, num_spikes2)+1],'k')

