%[text] ### Example 2: Using an existing python file to perform SPADE analysis
%[text] SPADE is a method to detect repeated spatio-temporal activity patterns in parallel spike train data that occur in excess to chance expectation. In this tutorial, we will use SPADE to detect the simplest type of such patterns, synchronous events that are found across a subset of the neurons considered (i.e., patterns that do not exhibit a *temporal extent*). We will demonstrate the method on stochastic data in which we control the patterns statistics. 
%[text] A python code has been provided to us in support of the analysis.  Let's review the Python code first! Open the file **`spade.py`** and explore its content. 
open 'spade.py'
